        \"Measurement Period\" Interval<DateTime>\r\n\r\ncontext Patient\r\n\r\ndefine
        \"SDE Ethnicity\":\r\n\t[\"Patient Characteristic Ethnicity\": \"Ethnicity\"]\r\n\r\ndefine
        \"SDE Payer\":\r\n\t[\"Patient Characteristic Payer\": \"Payer\"]\r\n\r\ndefine
        \"SDE Race\":\r\n\t[\"Patient Characteristic Race\": \"Race\"]\r\n\r\ndefine
        \"SDE Sex\":\r\n\t[\"Patient Characteristic Sex\": \"ONC Administrative Sex\"]\r\n\r\ndefine
        \"Qualifying Encounter\":\r\n\t( [\"Encounter, Performed\": \"Office Visit\"]\r\n\t\tunion
        [\"Encounter, Performed\": \"Face-to-Face Interaction\"]\r\n\t\tunion [\"Encounter,
        Performed\": \"Preventive Care Services - Established Office Visit, 18 and
        Up\"]\r\n\t\tunion [\"Encounter, Performed\": \"Preventive Care Services-Initial
        Office Visit, 18 and Up\"]\r\n\t\tunion [\"Encounter, Performed\": \"Home
        Healthcare Services\"]\r\n\t\tunion [\"Encounter, Performed\": \"Annual Wellness
        Visit\"] ) Encounter\r\n\t\twhere Encounter.relevantPeriod during \"Measurement
        Period\"\r\n\r\ndefine \"Initial Population\":\r\n\texists ( \"Qualifying
        Encounter\" )\r\n\t\tand AgeInYearsAt(start of \"Measurement Period\")>= 18\r\n\t\tand
        AgeInYearsAt(start of \"Measurement Period\")< 75\r\n\t\tand exists ( [\"Diagnosis\":
        \"Diabetes\"] DiabetesDx\r\n\t\t\t\twhere DiabetesDx.prevalencePeriod overlaps
        \"Measurement Period\"\r\n\t\t)\r\n\r\ndefine \"Denominator\":\r\n\t\"Initial
        Population\"\r\n\r\ndefine \"Denominator Exclusions\":\r\n\texists ( [\"Encounter,
        Performed\": \"Encounter Inpatient\"] DischargeHospice\r\n\t\t\twhere ( DischargeHospice.dischargeDisposition
        in \"Discharged to Home for Hospice Care\"\r\n\t\t\t\t\tor DischargeHospice.dischargeDisposition
        in \"Discharged to Health Care Facility for Hospice Care\"\r\n\t\t\t)\r\n\t\t\t\tand
        DischargeHospice.relevantPeriod ends during \"Measurement Period\"\r\n\t)\r\n\t\tor
        exists ( [\"Intervention, Order\": \"Hospice care ambulatory\"] HospiceOrder\r\n\t\t\t\twhere
        HospiceOrder.authorDatetime during \"Measurement Period\"\r\n\t\t)\r\n\t\tor
        exists ( [\"Intervention, Performed\": \"Hospice care ambulatory\"] HospicePerformed\r\n\t\t\t\twhere
        HospicePerformed.relevantPeriod overlaps \"Measurement Period\"\r\n\t\t)\r\n\r\ndefine
        \"Neuropathy Diagnoses\":\r\n\t( [\"Diagnosis\": \"Hypertensive Chronic Kidney
        Disease\"]\r\n\t\tunion [\"Diagnosis\": \"Kidney Failure\"]\r\n\t\tunion [\"Diagnosis\":
        \"Glomerulonephritis and Nephrotic Syndrome\"]\r\n\t\tunion [\"Diagnosis\":
        \"Diabetic Nephropathy\"]\r\n\t\tunion [\"Diagnosis\": \"Proteinuria\"] )
        Diagnoses\r\n\t\twhere Diagnoses.prevalencePeriod overlaps \"Measurement Period\"\r\n\r\ndefine
        \"Active ACEI or ARB\":\r\n\t[\"Medication, Active\": \"ACE Inhibitor or ARB\"]
        ACEIorARB\r\n\t\twhere ACEIorARB.relevantPeriod overlaps \"Measurement Period\"\r\n\r\ndefine
        \"Renal Procedures\":\r\n\t( [\"Procedure, Performed\": \"Kidney Transplant\"]\r\n\t\t\tunion
        [\"Procedure, Performed\": \"Vascular Access for Dialysis\"]\r\n\t\t\tunion
        [\"Procedure, Performed\": \"Dialysis Services\"]\r\n\t)\r\n\r\ndefine \"Renal
        Interventions\":\r\n\t[\"Intervention, Performed\": \"Other Services Related
        to Dialysis\"]\r\n\t\tunion [\"Intervention, Performed\": \"Dialysis Education\"]\r\n\r\ndefine
        \"ESRD Encounter\":\r\n\t[\"Encounter, Performed\": \"ESRD Monthly Outpatient
        Services\"]\r\n\r\ndefine \"Protein Urea Lab Test\":\r\n\t[\"Laboratory Test,
        Performed\": \"Urine Protein Tests\"] ProteinUrea\r\n\t\twhere ProteinUrea.result
        is not null\r\n\r\ndefine \"Nephropathy Screenings\":\r\n\t( \"Renal Procedures\"\r\n\t\tunion
        ( \"Renal Interventions\" RenalInterventions\r\n\t\t\t\treturn \"Procedure,
        Performed\" { relevantPeriod: RenalInterventions.relevantPeriod }\r\n\t\t)\r\n\t\tunion
        ( \"ESRD Encounter\" ESRDEncounter\r\n\t\t\t\treturn \"Procedure, Performed\"
        { relevantPeriod: ESRDEncounter.relevantPeriod }\r\n\t\t)\r\n\t\tunion ( \"Protein
        Urea Lab Test\" ProteinUrea\r\n\t\t\t\treturn \"Procedure, Performed\" { relevantPeriod:
        ProteinUrea.relevantPeriod }\r\n\t\t) ) Screenings\r\n\t\twhere Screenings.relevantPeriod
        during \"Measurement Period\"\r\n\r\ndefine \"Numerator\":\r\n\texists ( \"Active
        ACEI or ARB\" )\r\n\t\tor exists ( \"Neuropathy Diagnoses\" )\r\n\t\tor exists
        ( \"Nephropathy Screenings\" )\r\n\r\n--482666--\r\n"
